import styled from "styled-components";

export const Wrapper = styled.div `
	{	
        height: 100vh;
        width: 100vw;
		background-color: #2DBEFF;

	}
`;


export const WelcomeMessage = styled.div `
	top: 0;
	left: 0;
	padding-top: 2em;
	padding-left: 2em;

	height: 5em;
	h2 {
		align-items: left;
		max-width: 12em;
		max-height: 2em;
		margin: 0;
	}
`;

export const Content = styled.div `
    display: flex;
    flex-direction: column;
    width: 100%;
    height: 85%;

`;


export const LoadAtHomePic = styled.div `
	display: flex;
	flex:2;
	height: 5em;
	width: 50%;
	background-color:#2DBEFF;
	div {
	}

`;


export const NewBikePic = styled.div `
	display: flex;

	flex:2;
	max-height: 30%;
	width: 100%;
	background-color:#F7F9F9;
	justify-content: space-between;

	div {
		width: 33%;
		align-items: center;

	}

`;
